package com.pa.ipv01.object;

public class mytime {
	int h, m, type;

	public mytime(int h, int m, int type) {
		super();
		// TODO Auto-generated constructor stub
		this.h = h;
		this.m = m;
		this.type = type;

	}

	public int getH() {
		return h;
	}

	public void setH(int h) {
		this.h = h;
	}

	public int getM() {
		return m;
	}

	public void setM(int m) {
		this.m = m;
	}

	public int getType() {
		return type;
	}

	public void setType(int type) {
		this.type = type;
	}

}
